const Jumbo = () => (
  <div className="Jumbo">
    <Container>
      <h1 className="jumbotron-heading">
        Empowering Opportunity One Website at a Time
      </h1>
      <p className="jumbotron-text">
        Weâ€™ve built and analyzed over 10,000 websites over the last 15+ years
      </p>
      <p></p>
    </Container>
    <style jsx>{`
      .Jumbo {
        height: 450px;
        background-color: #eee;
      }
      .jumbotron-heading {
        text-align: center;
      }
      .jumbotron-text {
        text-align: center;
      }
    `}</style>
  </div>
);

export default Jumbo;
